    body:
      encoding: UTF-8
      string: '{"Format":"RIS","Label":"RIS Format","Data":"TY  - JOUR\u000d\u000aAU  -
        Simpson, Ace Volkmann\u000d\u000aAU  - Clegg, Stewart\u000d\u000aAU  - Pina
        e Cunha, Miguel\u000d\u000aT1  - Expressing Compassion in the Face of Crisis:
        Organizational Practices in the Aftermath of the Brisbane Floods of 2011.\u000d\u000aJO  -
        Journal of Contingencies & Crisis Management\u000d\u000aJF  - Journal of Contingencies
        & Crisis Management\u000d\u000aY1  - 2013\/06\/\/\u000d\u000aVL  - 21\u000d\u000aIS  -
        2\u000d\u000aM3  - Article\u000d\u000aSP  - 115\u000d\u000aEP  - 124\u000d\u000aPB  -
        Wiley-Blackwell\u000d\u000aSN  - 09660879\u000d\u000aAB  - Compassion is almost
        universally acknowledged as an important issue in the crisis management literature.
        The dominant perspective, however, approaches compassion instrumentally. The
        findings of this study on the compassionate support offered (or not) to employees
        during and after the Brisbane flood crisis of January 2011 provide insight
        into crisis management as a continuous process rather than a reactionary response
        when disaster arises. Three significant policy implications are generated:
        First, compassionate discourses and categorization schemas should be clearly
        articulated within the organization before crisis. Second, compassionate policies
        and practices need to be embedded in ongoing organizational routines and policies.
        Third, initiatives framed as compassion responses should not be assumed to
        necessarily create positive outcomes; rather, outcomes should be assessed
        on an ongoing basis. [ABSTRACT FROM AUTHOR]\u000d\u000aAB  - Copyright of
        Journal of Contingencies & Crisis Management is the property of Wiley-Blackwell
        and its content may not be copied or emailed to multiple sites or posted to
        a listserv without the copyright holder''s express written permission. However,
        users may print, download, or email articles for individual use. This abstract
        may be abridged. No warranty is given about the accuracy of the copy. Users
        should refer to the original published version of the material for the full
        abstract. (Copyright applies to all Abstracts.)\u000d\u000aKW  - COMPASSION\u000d\u000aKW  -
        FLOODS\u000d\u000aKW  - CRISIS management\u000d\u000aKW  - BRISBANE (Qld.)\u000d\u000aKW  -
        QUEENSLAND\u000d\u000aN1  - Accession Number: 87564228; Simpson, Ace Volkmann
        1; Email Address: ace.simpson@uts.edu.au Clegg, Stewart 1,2; Email Address:
        stewart.clegg@uts.edu.au Pina e Cunha, Miguel 2; Email Address: mpc@novasbe.pt;
